INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 103011, 16412, 10, 1, 16412030, 0, "シュバッ！　シュバババッ！\n色塗りはワタシにお任せデース！\nこの絵筆二刀流で、瞬く間に\nカラフルにしてみせマース！", 11, 0, 0.5);
