INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 100811, 16412, 10, 1, 16412035, 0, "絵の下書きはボクに任せて。\nすべての美しさの源になる存在……\nそれがボクだからね！", 11, 0, 0.5);
