INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 101311, 18812, 10, 1, 18812026, 0, "完☆成！\nぐうかわ魔法少女が描く、\nこれまたぐうかわな壁画をご覧あれ～！\nテーマは……努力！　友情！　勝利！", 11, 0, 0.5);
INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES ("", 0, 18812, "", "", 18812027, "", "", 91, "", "");
