INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 102711, 18812, 10, 1, 18812036, 0, "クスクス……違います。\nこれはあのおかたへの愛……\n枯れることのない、永遠の愛が\nテーマですわ……", 11, 0, 0.5);
INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES ("", 0, 18812, "", "", 18812037, "", "", 91, "", "");
