INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 105111, 18812, 10, 1, 18812041, 0, "これってテーマなんてあったの？\nあくまでギルドの仕事であって、\n指示書に忠実に描けばいいと\n思ってたんだけれど。", 11, 0, 0.5);
