INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 105611, 18812, 10, 1, 18812046, 0, "いやいや、それであってるよ。\nアイツら、やる気満々なのはいいけど、\n余計なもん描き足してないだろうね？\nあとで見ておくか……", 11, 0, 0.5);
