INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 105311, 19812, 10, 1, 19812034, 0, "いや、浮世絵って\nこんな感じだったか？\nオーエドで見たのは、もう少し\n違う雰囲気だった気がするのだが。", 11, 0, 0.5);
