INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 100811, 19812, 10, 1, 19812039, 0, "美を伝えるという点では同じだよ。\nボクだって歯磨きをするボクや\nお昼ご飯を食べるボクがいるけど、\n全て美しいボクには違いないでしょ？", 11, 0, 0.5);
