INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 100811, 23812, 10, 1, 23812026, 0, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 11, 0, 0.5);
