INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 104511, 23812, 10, 1, 23812031, 0, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 11, 0, 0.5);
