INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 103011, 27812, 10, 1, 27812031, 0, "おぉー、クウカがひいた曲線、\nすごくきれいデス！\nまるでウキヨエマスターみたいデスね！\nワタシにもその技、教えてクダサイ！", 11, 0, 0.5);
