INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 105511, 27812, 10, 1, 27812036, 0, "ニ、ニノンさんも上手でしたけど、\nクウカさんもすごい……！\nでも、クウカさんが興奮してるのは、\n違う理由のような……", 11, 0, 0.5);
