INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 100511, 28412, 10, 1, 28412022, 0, "これでバッチリッス！\nどうッスか？\nトラタイガーみたいにかっこよく\n描けてるんじゃないッスかね？", 11, 0, 0.5);
INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES ("", 0, 28412, "", "", 28412023, "", "", 91, "", "");
