INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 103711, 28412, 10, 1, 28412027, 0, "ふふっ、そうだね。\n君の憧れてるヒーローみたいに\nちゃんと描けてるよ。\n……一時はどうなるかと思ったけど。", 11, 0, 0.5);
INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES ("", 0, 28412, "", "", 28412028, "", "", 91, "", "");
