INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 107111, 28412, 10, 1, 28412032, 0, "このクリスティーナが手伝う以上、\n粗い仕事など許さん！\nまったく、オマエたちはもう少し、\n芸術を嗜むべきだぞ♪", 11, 0, 0.5);
