INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 104711, 28412, 10, 1, 28412037, 0, "クリスちゃんは相変わらずだね。\nでも、描き直したおかげで\nさらに良い絵になったと思うよ。\n私も鎧に絵の具がはねなくて一安心だ。", 11, 0, 0.5);
