INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 107111, 35812, 10, 1, 35812022, 0, "むっ……おい、マツリちゃん。\nしっぽの先がペンキで汚れているぞ。\nどれ、ワタシが丁寧に拭ってやろう♪", 11, 0, 0.5);
